About Modern Dairy

China Modern Dairy Holdings Ltd. (“Modern Dairy”) was established in September 2005, specializing in dairy farming and milk production. Modern Dairy (stock code: 01117) was successfully listed on the Hong Kong Stock Exchange on 26 November 2010, making itself the world’s first company listed using dairy farming resources.

